class Game {
    constructor(){
        this.players = []; // [socket, playernum]
        this.stateowners = []
        this.turn = 0;
        for(let i = 0; i < Object.keys(mapData["unitedstates"]).length; i++){
            if(i == 5){
                this.stateowners.push(0);
            }
            else if(i == 41){
                this.stateowners.push(1);
            }
            else if(i == 40){
                this.stateowners.push(2);
            }
            else{
                this.stateowners.push(-1);
            }
        }
    }

    Attack(index, playernumber){
        if(playernumber == this.turn){
            let adjacent = false;
            for(let i = 0; i < mapData["unitedstates"][index + 2][8].length; i++){
                if(this.stateowners[mapData["unitedstates"][index + 2][8][i]] == playernumber && this.stateowners[index] != playernumber){
                    adjacent = true;
                    break;
                }
            }
            if(adjacent){
                this.BroadcastNewConquest(playernumber, index);
                this.turn = (this.turn + 1) % 3;
            }
        }
    }
    
    BroadcastNewConquest(player, tile){
        let success = false;
        if(Math.random() < 0.4){
            success = true;
        }
        if(this.stateowners[tile] == -1){
            success = true;
        }
        if(success){
            this.stateowners[tile] = player;
        }
        for(let i = 0; i < this.players.length; i++){
            this.players[i][0].emit("conquest", player, tile, success);
        }
    }
}

let game = new Game();
let playernum = 0;

app.use(express.static(path.join(__dirname, 'public')));

io.on('connection', socket => {
    console.log("New Connection")

    socket.on("maprequest", (mapname) => {
        socket.emit("mapresponse", spritesheets[mapname], mapData[mapname])
    })

    socket.game = game;
    socket.playernumber = playernum;

    socket.on("attack", (index) => {
        socket.game.Attack(index, socket.playernumber)
    })

    game.players.push([socket, playernum]);
    playernum++;

})

io.listen(server);


